    lines = prefix.split("\n")
    consumed_lines = []
    current_column = 0
    for line in lines:
        stripped_line = line.lstrip()
        indentation = len(line) - len(stripped_line)
        if not stripped_line.startswith("#"):
            if current_column < column:
                if stripped_line:
                    consumed_lines.append(line)
                    current_column = indentation
            else:
